INSERT INTO `tbl_contents` VALUES ('116', '1', '-xuat-khau-det-may-vuot-moc-20-ty-usd', ' Xuất khẩu dệt may vượt mốc 20 tỷ USD', 'TT - Với hàng chục ngàn dòng thuế sẽ được cắt giảm về mức 0% theo lộ trình, ngành dệt may và da giày VN được nhận định sẽ hưởng lợi nhiều nhất từ TPP. Cuộc đua bắt đầu...', '<p style=\"padding: 0px 0px 10px; margin: 0px; color: rgb(40, 40, 40); font-family: tahoma, Helvetica, sans-serif; font-size: 12px; line-height: 17px; background-color: rgb(255, 255, 255);\">Theo số liệu mới nhất của Tổng cục Hải quan, kim ngạch xuất khẩu hàng dệt may trong 11 tháng năm 2015 đã vượt mốc 20 tỷ USD.</p><p style=\"padding: 0px 0px 10px; margin: 0px; color: rgb(40, 40, 40); font-family: tahoma, Helvetica, sans-serif; font-size: 12px; line-height: 17px; background-color: rgb(255, 255, 255);\"><img alt=\"Anysew.vn_Xuất khẩu dệt may vượt mốc 20 tỷ USD\" src=\"http://www.anysew.vn/CmsImage/Anysew/21_12-1-2015.png\" style=\"border: none;\"></p><p style=\"padding: 0px 0px 10px; margin: 0px; color: rgb(40, 40, 40); font-family: tahoma, Helvetica, sans-serif; font-size: 12px; line-height: 17px; background-color: rgb(255, 255, 255);\"><br>Trong đó, riêng kim ngạch xuất khẩu trong tháng 11/2015 đạt 1,71 tỷ USD, qua đó nâng trị giá xuất khẩu nhóm hàng này trong 11 tháng năm 2015 lên 20,63 tỷ USD, tăng 8,9% so với cùng kỳ năm 2014 (tương ứng tăng 1,69 tỷ USD).</p><p style=\"padding: 0px 0px 10px; margin: 0px; color: rgb(40, 40, 40); font-family: tahoma, Helvetica, sans-serif; font-size: 12px; line-height: 17px; background-color: rgb(255, 255, 255);\">Tính chung 11 tháng, kim ngạch xuất khẩu hàng dệt may sang thị trường Hoa Kỳ đạt 9,88 tỷ USD, tăng 11,7%; sang EU đạt 3,09 tỷ USD, tăng 3,5%; sang Nhật Bản đạt 2,53 tỷ USD, tăng 6,2% và sang Hàn Quốc đạt 1,98 tỷ USD, tăng 1,3% so với cùng kỳ năm trước.</p>', 'http://localhost/khaisang/images/blog4.png', '', '0', '0', '2016-07-20 11:06:39', '2016-10-21 17:06:44', '', '', '', '1');
INSERT INTO `tbl_contents` VALUES ('132', '1', 'an-do-nham-toi-xuat-khau-det-may-50-ty-usd-trong-n', 'Ấn Độ nhắm tới xuất khẩu dệt may 50 tỷ USD trong n', 'Theo ông Varma, Thư ký tổ chức Texprocil, thì xuất khẩu dệt may của nước này được kỳ vọng đạt 50 tỷ USD trong năm tài khóa này từ giá trị 38 tỷ USD của năm tài khóa 2016, là do kết quả của gói đặc biệt của Chính phủ và kế hoạch marketing cho ngành dệt may.', '<div>Ấn Độ nhắm tới xuất khẩu dệt may 50 tỷ USD trong năm tài khóa 2017</div><div><br></div><div>Theo ông Varma, Thư ký tổ chức Texprocil, thì xuất khẩu dệt may của nước này được kỳ vọng đạt 50 tỷ USD trong năm tài khóa này từ giá trị 38 tỷ USD của năm tài khóa 2016, là do kết quả của gói đặc biệt của Chính phủ và kế hoạch marketing cho ngành dệt may.</div><div>Tuần trước chính phủ Liên bang đã tuyên bố một gói đặc biệt trị giá 60.000 nghìn tỷ Rupi &nbsp;cho ngành để tạo ra 10 triệu việc làm trong 3 năm và hấp dẫn 11 tỷ USD đầu tư khi nhắm tới có thêm 30 tỷ USD trong xuất khẩu.</div><div>Ấn Độ hy vọng rằng các thị trường chủ chốt như là châu Âu và Mỹ sẽ tiếp tục tăng trưởng. Ấn Độ cũng đang tìm kiếm các thị trường mới như Nga, Iran và Nam Mỹ để mở rộng tầm với và đa dạng hóa sản phẩm để đạt mục tiêu xuất khẩu.</div><div>Nước này sẵn sàng tạo ra hiệu quả từ thị phần sụt giảm của Trung Quốc trong xuất khẩu dệt may trên thị trường quốc tế. Thị phần của Trung Quốc đã giảm từ 40% xuống còn 38% do lương cao và Trung Quốc đang tiến vào thị trường dành cho sản phẩm kỹ thuật đắt tiền.</div><div>Bình luận về việc Anh rời EU, ông Verma nói “Ấn Độ xuất khẩu dệt may trị giá 10 tỷ USD vào EU, trong đó 23% là đi vào thị trường Anh. Với viễn cảnh Anh tời EU, Ấn Độ chú trọng vào Hiệp định mậu dịch ưu đãi với Anh và đây là lúc để đàm phán các điều khoản. Bản dự thảo chính sách dệt mới đã sẵn sàng và gói hỗ trợ tuyên bố tuần trước là một phần của chính sách mới. Chính sách sẽ được trình lên nội các vào tháng tới để phê chuẩn”.</div>', 'http://localhost/khaisang/images/blog3.png', 'Nguyễn Hoàng Minh', '0', '0', '2016-07-20 21:40:58', '2016-10-21 17:06:39', '', '', '', '1');
INSERT INTO `tbl_contents` VALUES ('133', '1', 'nhung-tac-dong-cua-tpp-toi-kinh-te-viet-nam', 'Những tác động của TPP tới kinh tế Việt Nam', 'Việc tham gia vào Hiệp định Đối tác kinh tế xuyên Thái Bình Dương (TPP) sẽ mở ra nhiều cơ hội và không ít thách thức đối với nền kinh tế Việt Nam. ', '<div><br></div><div>Việc tham gia vào Hiệp định Đối tác kinh tế xuyên Thái Bình Dương (TPP) sẽ mở ra nhiều cơ hội và không ít thách thức đối với nền kinh tế Việt Nam. GDP của Việt Nam sẽ tăng nhanh nhờ tăng trưởng xuất nhập khẩu, tăng thu hút vốn đầu tư trực tiếp và thúc đẩy tiêu dùng dịch vụ. Tuy nhiên, TPP cũng đặt ra những thách thức không nhỏ. Tận dụng những lợi thế to lớn của TPP như thế nào là bài toán không dễ đối với cơ quan quản lý và doanh nghiệp và với nền kinh tế Việt Nam.</div><div style=\"text-align: center;\"><img src=\"http://anysew.phucuongads.com/images/1_284482.jpg\" alt=\"\" align=\"\" border=\"0px\"></div><div style=\"text-align: center;\"><span style=\"font-style: italic;\">Ảnh minh họa. Nguồn: internet</span></div><div><span style=\"font-weight: bold;\">Tác động trực tiếp đến GDP</span></div><div><span style=\"font-weight: bold;\"><br></span></div><div>Theo hãng nghiên cứu Eurasia Group, đến năm 2025, GDP của Việt Nam sẽ tăng thêm 11%, tương đương 36 tỷ USD. Bộ Công Thương cũng cho rằng, TPP có thể giúp GDP của Việt Nam tăng thêm 33,5 tỷ USD và xuất khẩu tăng thêm 68 tỷ USD trong vòng một thập niên tới. Động lực để tăng trưởng GDP là từ tăng trưởng xuất nhập khẩu, tăng thu hút vốn đầu tư trực tiếp và thúc đẩy tiêu dùng, dịch vụ.</div><div>TPP được kỳ vọng sẽ tạo ra một bước nhảy vọt để Việt Nam đẩy mạnh xuất khẩu và nâng cao năng lực cạnh tranh trong nước. Sau khi hiệp định TPP đưa vào thực hiện, các mặt hàng chủ lực của Việt nam như dệt may, da giảy, thủy sản, đồ gỗ… sẽ được miễn giảm thuế đáng kể khi tiếp cận thị trường Mỹ, Úc và các nước đối tác khác. Ngoài ra, hiện Việt Nam đang xuất siêu vào Mỹ nhiều nhất và xuất siêu đến 7 trong tổng số 12 nước thành viên TPP. Do đó, Việt Nam có thể hưởng lợi nhiều nhất từ TPP để thúc đẩy tăng trưởng xuất khẩu.</div><div>Do vốn đầu tư trực tiếp nước ngoài (FDI) đóng vai trò là một trụ cột trong chiến lược phát triển đất nước, Việt Nam đã nỗ lực rất lớn trong những năm gần đây để cải thiện môi trường đầu tư. Với những nỗ lực của Việt Nam và tiềm năng của TPP trong việc giúp mở rộng xuất khẩu, chắc chắn sẽ tạo ra một dòng vốn FDI lớn chảy vào trong nước.</div><div><br></div><div><span style=\"font-weight: bold;\">Tác động gián tiếp đến cải cách kinh tế</span></div><div><span style=\"font-weight: bold;\"><br></span></div><div>Về cơ bản, TPP quy định rằng DNNN hay đơn vị độc quyền của các nước thành viên sẽ phải hoạt động dựa trên các nguyên tắc thị trường, trừ khi điều này cản trở nhiệm vụ cung cấp các dịch vụ công của Nhà nước. Các DNNN sẽ được đối xử như các loại hình DN khác. Theo Hiệp định TPP, các nước thành viên phải minh bạch hóa hoạt động của DNNN bằng cách cung cấp tất cả các thông tin liên quan. Do đó, TPP sẽ là động lực quan trọng để Việt Nam đẩy mạnh cải cách DNNN, đặc biệt là việc cổ phần hóa các DN này.</div><div>TPP có tiêu chuẩn cao về bảo hộ sở hữu trí tuệ, bao gồm quy định phải thực hiện thủ tục tố tụng và chế tài hình sự đối với hành vi xâm phạm tài sản trí tuệ quy mô thương mại. Trong ngắn hạn, việc thực thi các quy định sẽ làm tăng gánh nặng chi phí cho DN Việt Nam, đặc biệt là các DN nhỏ và vừa. Tuy nhiên, trong dài hạn, sẽ giúp DN có động lực mạnh mẽ hơn để đầu tư vào các ngành công nghiệp sáng tạo mà Việt Nam đang tìm cách phát triển.</div><div>Tác động tới thị trường chứng khoán Việt Nam</div><div>TPP có những tác động tích cực đến thị trường chứng khoán. Thực tế cho thấy, ngay sau khi kết thúc đàm phán TPP, các chỉ số trên cả hai sàn chứng khoán Hà Nội và TP. Hồ Chí Minh đã có sự biến động, tăng giá sau khi kết thúc đàm phán TPP. Các mã ngành như dệt may, thủy sản, khu công nghiệp, phân phối ô tô… trở nên hấp dẫn hơn với nhà đầu tư. Mặc dù vốn hóa của các DN hưởng lợi từ TPP chiếm tỷ trọng không lớn nhưng thông tin này là chất xúc tác khá mạnh cho sự bùng nổ của thị trường chứng khoán. Tất nhiên, những tác động vừa qua chỉ là hiệu ứng tâm lý, có tính chất ngắn hạn. Về lâu dài, thị trường chứng khoán sẽ phản ánh rõ nét những tác động của TPP đối với kinh tế của nước ta. Khi Hiệp định TPP có hiệu lực, hàng hóa giao dịch trên thị trường chứng khoán sẽ được cải thiện đáng kể về chất lượng.</div><div><br></div><div><span style=\"font-weight: bold;\">Tác động đến ngành Dệt may</span></div><div><span style=\"font-weight: bold;\"><br></span></div><div>Nhóm ngành Dệt may được coi là một trong những trụ cột xuất khẩu của Việt Nam, chiếm 14% tổng kim ngạch xuất khẩu (tương đương 21 tỷ USD). Tuy nhiên, mặt hàng chủ yếu lại là gia công hàng may mặc với đầu vào là vải nhập chủ yếu từ các nước không phải thành viên TPP. Mỹ là thị trường lớn nhất của Việt Nam, hiện tại đang phải chịu mức thuế suất đối với các sản phẩm may mặc từ 5-25%, giày dép là 20%, túi sách là 16%. Khi hiệp định TPP có hiệu lực, mức thuế suất trên sẽ ở mức 0%, từ đó kích thích xuất khẩu nhiều hơn và đương nhiên là những DN dệt may sẽ hưởng lợi.</div><div><span style=\"font-weight: bold;\"><br></span></div><div><span style=\"font-weight: bold;\">Phát triển khu công nghiệp</span></div><div><span style=\"font-weight: bold;\"><br></span></div><div>TPP sẽ làm gia tăng FDI vào Việt Nam, đặc biệt đến từ các quốc gia không phải là thành viên đầu tư chủ yếu vào sản xuất, dẫn đến các DN xây dựng khu công nghiệp được hưởng lợi. Hiệp định TPP kỳ vọng sẽ thu hút nguồn vốn FDI vào các lĩnh vực dệt may, thủy sản, gỗ, linh kiện điện tử… và sẽ làm gia tăng nhu cầu thuê đất tại các khu công nghiệp. Cơ hội tăng trưởng sẽ đến với các DN như: Sở hữu quỹ đất đủ lớn để có thể tiếp tục mở rộng cho thuê; Có vị trí thuận lợi như gần sân bay, cảng biển, nguồn nguyên liệu; Có nhiều chính sách ưu đãi hấp dẫn.</div><div><span style=\"font-weight: bold;\"><br></span></div><div><span style=\"font-weight: bold;\">Nhóm ngành cảng biển và logistic</span></div><div><span style=\"font-weight: bold;\"><br></span></div><div>Trong giai đoạn 1992-2008, giá trị thương mại tăng trưởng mạnh mẽ với tốc độ bình quân 20,3%/năm, đạt 143,4 tỷ USD. Năm 2009, giá trị thương mại sụt giảm 11,4% so với năm 2008 do ảnh hưởng từ khủng hoảng kinh tế toàn cầu. Sau đó, giá trị thương mại phục hồi và tiếp tục tăng trưởng với tốc độ bình quân 18,6% trong giai đoạn 2009-2014. Năm 2014, kim ngạch xuất nhập khẩu của Việt Nam đạt mức 298,24 tỷ USD, tăng 12,94% so với cùng kỳ. Giá trị thương mại của Việt Nam với các quốc gia đang tham gia vòng đàm phán TPP có quy mô lớn thứ ba sau WTO và APEC, chiếm đến 31% tổng kim ngạch xuất khẩu Việt Nam.</div><div>Với lý do trên, nhóm ngành cảng biển và logistics sẽ được hưởng lợi từ nhu cầu xuất nhập khẩu tăng cao giữa khu vực châu Âu và Bắc Mỹ khi TPP được thông qua. Theo dự báo, hàng hóa thông qua các cảng biển của Việt Nam có thể duy trì tốc độ tăng trưởng từ 8% - 9% và nhu cầu có thể vượt cung vào năm 2018 tại các cảng ở khu vực phía bắc.</div><div><span style=\"font-weight: bold;\"><br></span></div><div><span style=\"font-weight: bold;\">Nhóm ngành phân phối ô tô</span></div><div><span style=\"font-weight: bold;\"><br></span></div><div>Kim ngạch nhập khẩu ô tô từ Mỹ và Nhật Bản chiếm khoảng 13% tổng kim ngạch nhập khẩu ô tô của Việt Nam. Các dòng xe của Nhật và Mỹ như Honda, Toyota, Ford chiếm khoảng 45% cơ cấu tiêu thụ toàn bộ thị trường. Gia nhập TPP, còn mở ra cho Việt Nam cơ hội tiếp cận với các công ty sản xuất ô tô hàng đầu thông qua kênh tìm kiếm nhà cung cấp linh kiện và thị trường để bán thành phẩm. Đặc biệt, TPP còn là cầu nối đưa Việt Nam đến với các thị trường lớn nhất thế giới về tiêu thụ ô tô như Bắc Mỹ và Mexico. Tuy nhiên, thách thức đặt ra là, việc giảm thuế nhập khẩu về 0% sẽ tác động không nhỏ đến ngành công nghiệp ô tô Việt Nam. Nếu không có chiến lược phù hợp thì ngành công nghiệp ô tô trong nước vẫn “giậm chân tại chỗ”.</div><div>Theo Tạp chí Tài chính</div>', 'http://localhost/khaisang/images/blog2.png', 'Theo Tạp chí Tài chính', '0', '0', '2016-07-20 21:46:29', '2016-10-21 17:06:34', '', '', '', '1');
