INSERT INTO `tbl_mnuitem_text` VALUES ('196', '196', 'Chuyển phát nội địa ', '<span style=\"color: rgb(34, 34, 34); font-family: robotoregular; font-size: 16px; line-height: 22.8571px; background-color: rgb(255, 255, 255);\">Ngoài dịch vụ chuyển phát nhanh thông thường trong cả 68 tỉnh thành trên cả nước,ALPHAEXPRESS còn đảm nhận dịch vụ hỏa tốc hẹn giờ “ nhận tận tay, phát tận tay ” luôn đảm bảo giao – nhận hàng đúng giờ hẹn theo cam kết.</span><div style=\"box-sizing: border-box; color: rgb(34, 34, 34); font-family: robotoregular; font-size: 16px; line-height: 22.8571px; background-color: rgb(255, 255, 255);\">Hiện tại, ALPHAEXPRESS đã và đang cung cấp nhiều dịch vụ như : đóng gói, lưu trữ, phân phát, giao nhận thư từ, hàng mẫu, tài liệu thông tin quảng cáo, thư mời tham gia hội nghị, … cho nhiểu Ngân hàng, tổ chức tài chính danh tiếng, công ty chứng khoán và các hãng cung cấp hàng hóa, các loại thực phẩm lớn hàng đầu thế giới, …</div>', '0', null);
