INSERT INTO `tbl_mnuitem_text` VALUES ('214', '214', 'Tầm nhìn', '<p style=\"font-stretch: normal; font-size: 12px; font-family: Arial, Helvetica, sans-serif; padding: 0px; margin: 0px; line-height: 21.6px; background-color: rgb(255, 255, 255);\"><span style=\"font-weight: bold;\">Tầm nhìn:</span></p><blockquote style=\"font-family: Arial, Helvetica, sans-serif; font-size: 12px; line-height: 21.6px; background-color: rgb(255, 255, 255);\"><p style=\"font-stretch: normal; padding: 0px; margin: 0px; line-height: 1.8em;\">Trở thành thương hiệu hàng đầu trong ngành<span style=\"font-weight: bold;\">&nbsp;</span>dịch vụ cung cấp thịt bò tơ tươi sạch ở Việt Nam</p></blockquote><p style=\"font-stretch: normal; font-size: 12px; font-family: Arial, Helvetica, sans-serif; padding: 0px; margin: 0px; line-height: 21.6px; background-color: rgb(255, 255, 255);\"><span style=\"font-weight: bold;\">Sứ mệnh:</span></p><blockquote style=\"font-family: Arial, Helvetica, sans-serif; font-size: 12px; line-height: 21.6px; background-color: rgb(255, 255, 255);\"><p style=\"font-stretch: normal; padding: 0px; margin: 0px; line-height: 1.8em;\">Mang đến những giá trị gia tăng cho cổ đông và thành viên Công ty.</p><p style=\"font-stretch: normal; padding: 0px; margin: 0px; line-height: 1.8em;\">Mang đến sự chuyên nghiệp và đẳng cấp quốc tế cho thương hiệu công ty.</p><p style=\"font-stretch: normal; padding: 0px; margin: 0px; line-height: 1.8em;\">Mang đến sự trải nghiệm hoàn hảo cho khách hàng<span style=\"font-weight: bold;\">.</span></p><p style=\"font-stretch: normal; padding: 0px; margin: 0px; line-height: 1.8em;\"><span style=\"font-weight: bold;\"><br></span></p><p style=\"font-stretch: normal; padding: 0px; margin: 0px; line-height: 1.8em;\"><span style=\"font-weight: bold;\"><br></span></p></blockquote>', '0', null);
