INSERT INTO `tbl_modules_text` VALUES (null, '44', 'Banner', '<div id=\"myCarousel\" class=\"carousel slide\" data-ride=\"carousel\"><ol class=\"carousel-indicators\"><li data-target=\"#myCarousel\" data-slide-to=\"0\" class=\"active\"></li><li data-target=\"#myCarousel\" data-slide-to=\"1\"></li><li data-target=\"#myCarousel\" data-slide-to=\"2\"></li></ol><div class=\"carousel-inner\" role=\"listbox\"><div class=\"item active\"><img src=\"http://demo.thietkewebigf.com/phanvisinh/images/banner.png\" alt=\"Banner 1\" class=\"img-responsive\"></div><div class=\"item\"><img src=\"http://demo.thietkewebigf.com/phanvisinh/images/banner.png\" alt=\"Banner 2\" class=\"img-responsive\"></div><div class=\"item\"><img src=\"http://demo.thietkewebigf.com/phanvisinh/images/banner.png\" alt=\"Banner 3\" class=\"img-responsive\"></div></div><a class=\"left carousel-control\" href=\"#myCarousel\" role=\"button\" data-slide=\"prev\"><span class=\"glyphicon glyphicon-chevron-left\" aria-hidden=\"true\"></span><span class=\"sr-only\">Previous</span></a><a class=\"right carousel-control\" href=\"#myCarousel\" role=\"button\" data-slide=\"next\"><span class=\"glyphicon glyphicon-chevron-right\" aria-hidden=\"true\"></span><span class=\"sr-only\">Next</span></a></div>', '0', null);
INSERT INTO `tbl_modules_text` VALUES (null, '54', 'Công dụng', '<h3>Công dụng phân hữu cơ vi sinh</h3><div>Tăng sản lượng cây trồng. </div><div>Bảo vệ môi trường, sức khỏe cộng đồng và sức khỏe người tiêu dùng</div><div><a href=\"#\" class=\"readmore\">Đọc thêm </a></div>', '0', null);
INSERT INTO `tbl_modules_text` VALUES (null, '55', 'Thành phần', '<h3>Thành phần phân hữu cơ vi sinh</h3><div>Đạm (N): Tăng cường sự sinh trưởng và phát triển của cây trồng</div><div>Lân (P2O5): Thúc đẩy ra rễ, hình thành</div><div><a href=\"#\" class=\"readmore\">Đọc thêm </a></div>', '0', null);
INSERT INTO `tbl_modules_text` VALUES (null, '56', 'Lợi ích', '<h3>Lợi ích phân hữu cơ vi sinh</h3><div>Không độc hại, không chứa vi sinh vật gây bệnh, thân thiện với MT, chi phí hợp lý và mang lại hiệu quả cao khi sd</div><div><a href=\"#\" class=\"readmore\">Đọc thêm </a></div>', '0', null);
INSERT INTO `tbl_modules_text` VALUES (null, '57', 'Quy chế quản lý hoạt động CLB AQLife', '<h2>QUY CHẾ QUẢN LÝ HOẠT ĐỘNG CLB AQLIFE</h2><div><div>Tổ chức các hoạt động từ thiện, thăm hỏi, tặng quà và giúp đỡ những trẻ em vùng sâu vùng xa, trẻ em khuyết tật, mồ côi, </div><div>lang thang cơ nhỡ và các trẻ em có hoàn cảnh đặc biêt khó khăn.<br><br></div><div>Thăm hỏi tặng quà các thương bệnh binh, cá nhân nhiễm chất độc màu da cam, những gia đình chính sách gặp khó khăn.<br><br></div><div>Tổ chức vận động quyên góp sách vở quần áo, hiện vật và tài chính cho các dự án từ thiện của CLB</div></div><div><br></div><div><br></div><div><a href=\"#\" class=\"readmore\">ĐỌC THÊM</a></div>', '0', null);
INSERT INTO `tbl_modules_text` VALUES (null, '52', 'Partner', '<table width=\\\"100%\\\" border=\\\"0\\\" cellspacing=\\\"0\\\" cellpadding=\\\"0\\\"><tbody><tr><td width=\\\"302\\\" align=\\\"left\\\" valign=\\\"top\\\"><p><a href=\\\"aisan/\\\"><img src=\\\"images/bana_noiku.jpg\\\" alt=\\\"\\\" width=\\\"288\\\" height=\\\"110\\\" class=\\\"sp_b05\\\" id=\\\"noiku_bana\\\" name=\\\"noiku_bana\\\"></a></p>- Phòng chống bệnh tật và tăng cường đề kháng cho cơ thể<br>- Chống lão hóa kéo dài tuổi thọ, giảm nguy cơ bệnh tật<br>- Hỗ trợ làm đẹp, hỗ trợ điều trị rất nhiều chứng và bệnh.</td><td width=\\\"288\\\" align=\\\"left\\\" valign=\\\"top\\\"><p><a href=\\\"http://syokuryo.jp/\\\" target=\\\"_blank\\\"><span style=\\\"font-size: 10pt;\\\"><img src=\\\"images/bana_food.jpg\\\" alt=\\\"\\\" width=\\\"288\\\" height=\\\"110\\\" class=\\\"sp_b05\\\" id=\\\"food_bana\\\" name=\\\"food_bana\\\"></span></a></p><span style=\\\"text-align: justify;\\\">Theo Bộ Y tế VN định nghĩa </span>thực phẩm chức năng<span style=\\\"text-align: justify;\\\">: <br>là thực phẩm dùng để hỗ trợ chức năng của các bộ phận trong cơ thể người, có tác dụng dinh dưỡng, tạo cho cơ thể tình trạng thoải mái, tăng sức đề kháng và giảm bớt nguy cơ gây bệnh.</span></td></tr></tbody></table>', '0', null);
