INSERT INTO `tbl_recruitment` VALUES ('114', '7', '0', '2016-06-30', 'tuyen-nhan-vien-phuc-vu-ban-thang-052016', 'Tuyển nhân viên phục vụ bàn tháng 05/2016', '', '<div style=\"text-align: center;\"><span style=\"color: rgb(29, 33, 41); font-family: helvetica, arial, sans-serif; font-size: 14px; line-height: 19.32px; font-weight: bold; background-color: rgb(255, 255, 255);\">TUYỂN NHÂN VIÊN PHỤC VỤ&nbsp;</span></div><span style=\"color: rgb(29, 33, 41); font-family: helvetica, arial, sans-serif; font-size: 14px; line-height: 19.32px; background-color: rgb(255, 255, 255);\"><div style=\"text-align: center;\"><span style=\"line-height: 19.32px; font-style: italic;\">Hệ thống nhà hàng Bò Tơ Tây Ninh Tài Sanh cần tuyển</span></div></span><span style=\"color: rgb(29, 33, 41); font-family: helvetica, arial, sans-serif; font-size: 14px; line-height: 19.32px; font-weight: bold; text-decoration: underline; background-color: rgb(255, 255, 255);\">1. Yêu cầu:</span><br style=\"color: rgb(29, 33, 41); font-family: helvetica, arial, sans-serif; font-size: 14px; line-height: 19.32px; background-color: rgb(255, 255, 255);\"><span style=\"color: rgb(29, 33, 41); font-family: helvetica, arial, sans-serif; font-size: 14px; line-height: 19.32px; background-color: rgb(255, 255, 255);\">- Nhân viên: Nữ&nbsp;</span><br style=\"color: rgb(29, 33, 41); font-family: helvetica, arial, sans-serif; font-size: 14px; line-height: 19.32px; background-color: rgb(255, 255, 255);\"><span style=\"color: rgb(29, 33, 41); font-family: helvetica, arial, sans-serif; font-size: 14px; line-height: 19.32px; background-color: rgb(255, 255, 255);\">- Tuổi: từ 15 - 23.</span><span class=\"text_exposed_show\" style=\"display: inline; color: rgb(29, 33, 41); font-family: helvetica, arial, sans-serif; font-size: 14px; line-height: 19.32px; background-color: rgb(255, 255, 255);\"><br>- Số lượng : 15 nhân viên.<br>- Ngoại hình: khá, ưa nhìn, giao tiếp tốt.<br>- Có khả năng làm việc tập thể tốt, có tinh thần tự giác trong công việc.<br>- Nhanh nhẹn, trung thực.</span><div><span class=\"text_exposed_show\" style=\"display: inline; color: rgb(29, 33, 41); font-family: helvetica, arial, sans-serif; font-size: 14px; line-height: 19.32px; background-color: rgb(255, 255, 255);\"><span style=\"font-weight: bold; text-decoration: underline;\"><br>2. Mức lương</span><br>- Lương từ 3.200.000 đồng đến 5.000.000 đồng.<br>- Thời gian làm việc: 8 tiếng, 12 tiếng tùy thuộc vào khả năng và sức khỏe.</span></div><div><span class=\"text_exposed_show\" style=\"display: inline; color: rgb(29, 33, 41); font-family: helvetica, arial, sans-serif; font-size: 14px; line-height: 19.32px; background-color: rgb(255, 255, 255);\"><br><span style=\"font-weight: bold; text-decoration: underline;\">3. Quyền lợi</span><br>- Được hưởng lương, thưởng, tips<br>- Được hưởng các chế độ của người lao động theo Luật lao động.<br>- Có hỗ trợ ăn ở cho nhân viên.</span></div><div><span class=\"text_exposed_show\" style=\"display: inline; color: rgb(29, 33, 41); font-family: helvetica, arial, sans-serif; font-size: 14px; line-height: 19.32px; background-color: rgb(255, 255, 255);\"><br><span style=\"font-weight: bold; text-decoration: underline;\">4. Hồ sơ</span><br>- Chuẩn bị 01 bộ hồ sơ xin việc đầy đủ.</span></div><div><span class=\"text_exposed_show\" style=\"display: inline; color: rgb(29, 33, 41); font-family: helvetica, arial, sans-serif; font-size: 14px; line-height: 19.32px; background-color: rgb(255, 255, 255);\"><br></span></div><div><span class=\"text_exposed_show\" style=\"display: inline; color: rgb(29, 33, 41); font-family: helvetica, arial, sans-serif; font-size: 14px; line-height: 19.32px; background-color: rgb(255, 255, 255);\"><span style=\"font-weight: bold;\"><span style=\"line-height: 19.32px;\">[MÔ TẢ CÔNG VIỆC]</span><br style=\"line-height: 19.32px;\"><span style=\"line-height: 19.32px;\">$ Đón khách và dẫn khách vào bàn.</span><br style=\"line-height: 19.32px;\"><span style=\"line-height: 19.32px;\">$ Tư vấn và Order món cho khách.</span><br style=\"line-height: 19.32px;\"><span style=\"line-height: 19.32px;\">$ Chăm sóc bàn ăn cho khách.</span><br style=\"line-height: 19.32px;\"><span style=\"line-height: 19.32px;\">$ Giải đáp các thắc mắc của khách hàng về dịch vụ cũng như món ăn đồ uống của nhà hàng.</span><br style=\"line-height: 19.32px;\"><span style=\"line-height: 19.32px;\">$ Dọn dẹp và setup bàn để đón khách.</span></span><br>~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~<br><span style=\"font-weight: bold;\">Liên hệ</span>:<span class=\"Apple-tab-span\" style=\"white-space:pre\">	</span>&nbsp;Mr Tiến: 0948.665.656</span></div><div><span class=\"text_exposed_show\" style=\"display: inline; color: rgb(29, 33, 41); font-family: helvetica, arial, sans-serif; font-size: 14px; line-height: 19.32px; background-color: rgb(255, 255, 255);\"><span class=\"Apple-tab-span\" style=\"white-space:pre\">		</span>Ms Hương : 04 7300 6156</span></div><div></div><div><span class=\"text_exposed_show\" style=\"display: inline; color: rgb(29, 33, 41); font-family: helvetica, arial, sans-serif; font-size: 14px; line-height: 19.32px; background-color: rgb(255, 255, 255);\"><span class=\"Apple-tab-span\" style=\"white-space:pre\">		</span>E-mail: huongtn.dtqn@gmail.com&nbsp;<br><br></span></div>', '', null, '0', '1', '0000-00-00 00:00:00', '2016-05-19 16:29:08', '', '', '', '1');
INSERT INTO `tbl_recruitment` VALUES ('115', '7', '0', '2016-08-30', 'tuyen-dung-nhan-su-thang-082016', 'Tuyển dụng nhân sự tháng 08/2016', 'Hệ thống Nhà hàng Bò tơ Tây Ninh Tài Sanh khu vực Hà Nội chúng tôi cần tuyển các vị trí sau', '<p class=\"MsoNormal\" align=\"center\" style=\"text-align:center\"><span style=\"font-weight: bold;\">­­HỆ THỐNG NHÀ HÀNG BÒ TƠ CẦN TUYỂN<o:p startcont=\"this\"></o:p></span></p><p class=\"MsoNormal\" align=\"center\" style=\"text-align:center\"><span style=\"font-weight: bold;\">----------------//---------------</span></p>\r\n\r\n<p class=\"MsoNormal\" style=\"text-align: center;\"><span style=\"font-style: italic;\">Hệ thống nhà hàng bò tơ khu vực Hà Nội chúng tôi cần tuyển\r\ncác vị trí sau:</span></p>\r\n\r\n<p class=\"MsoListParagraphCxSpFirst\" style=\"margin-left:32.2pt;mso-add-space:\r\nauto;text-indent:-.25in;mso-list:l0 level1 lfo1\"><!--[if !supportLists]--><span style=\"font-weight: bold;\">1.<span style=\"font-weight: normal; font-stretch: normal;\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; </span></span><!--[endif]--><span style=\"font-weight: bold;\">Quản lý nhà hàng<o:p></o:p></span></p>\r\n\r\n<p class=\"MsoListParagraphCxSpMiddle\" style=\"margin-left:32.2pt;mso-add-space:\r\nauto;text-indent:-.25in;mso-list:l0 level1 lfo1\"><!--[if !supportLists]--><span style=\"font-weight: bold;\">2.<span style=\"font-weight: normal; font-stretch: normal;\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; </span></span><!--[endif]--><span style=\"font-weight: bold;\">Giám sát nhà hàng<o:p></o:p></span></p>\r\n\r\n<p class=\"MsoListParagraphCxSpMiddle\" style=\"margin-left:32.2pt;mso-add-space:\r\nauto;text-indent:-.25in;mso-list:l0 level1 lfo1\"><!--[if !supportLists]--><span style=\"font-weight: bold;\">3.<span style=\"font-weight: normal; font-stretch: normal;\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; </span></span><!--[endif]--><span style=\"font-weight: bold;\">Tổ trưởng bàn<o:p></o:p></span></p>\r\n\r\n<p class=\"MsoListParagraphCxSpMiddle\" style=\"margin-left:32.2pt;mso-add-space:\r\nauto;text-indent:-.25in;mso-list:l0 level1 lfo1\"><!--[if !supportLists]--><span style=\"font-weight: bold;\">4.<span style=\"font-weight: normal; font-stretch: normal;\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; </span></span><!--[endif]--><span style=\"font-weight: bold;\">Nhân viên phục vụ<o:p></o:p></span></p>\r\n\r\n<p class=\"MsoListParagraphCxSpMiddle\" style=\"margin-left:32.2pt;mso-add-space:\r\nauto;text-indent:-.25in;mso-list:l0 level1 lfo1\"><!--[if !supportLists]--><span style=\"font-weight: bold;\">5.<span style=\"font-weight: normal; font-stretch: normal;\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; </span></span><!--[endif]--><span style=\"font-weight: bold;\">Nhân viên Lễ tân<o:p></o:p></span></p>\r\n\r\n<p class=\"MsoListParagraphCxSpMiddle\" style=\"margin-left:32.2pt;mso-add-space:\r\nauto;text-indent:-.25in;mso-list:l0 level1 lfo1\"><!--[if !supportLists]--><span style=\"font-weight: bold;\">6.<span style=\"font-weight: normal; font-stretch: normal;\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; </span></span><!--[endif]--><span style=\"font-weight: bold;\">Nhân viên bảo vệ<o:p></o:p></span></p>\r\n\r\n<p class=\"MsoListParagraphCxSpLast\" style=\"margin-left:32.2pt;mso-add-space:auto;\r\ntext-indent:-.25in;mso-list:l0 level1 lfo1\"><!--[if !supportLists]--><span style=\"font-weight: bold;\">7.<span style=\"font-weight: normal; font-stretch: normal;\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; </span></span><!--[endif]--><span style=\"font-weight: bold;\">Nhân viên bếp -&nbsp; vị trí chảo chính</span>.</p>\r\n\r\n<p class=\"MsoNormal\"><span style=\"font-weight: bold;\">** Yêu cầu: <o:p></o:p></span></p>\r\n\r\n<p class=\"MsoNormal\" style=\"margin-top: 12pt;\">- Giới tính:Nam/nữ\r\n.</p>\r\n\r\n<p class=\"MsoNormal\" style=\"margin-top: 12pt;\">- Tuổi: từ 18\r\ntrở lên.</p>\r\n\r\n<p class=\"MsoNormal\" style=\"margin-top: 12pt;\">- Chăm chỉ, hoạt\r\nbát, trung thực.</p>\r\n\r\n<p class=\"MsoNormal\"><span style=\"font-weight: bold;\">** Mức lương:</span> Thỏa thuận theo từng vị trí ứng tuyển.</p>\r\n\r\n<p class=\"MsoNormal\"><span style=\"font-weight: bold;\">** Quyền lợi được hưởng:<o:p></o:p></span></p>\r\n\r\n<p class=\"MsoListParagraphCxSpFirst\" style=\"text-indent:-.25in;mso-list:l1 level1 lfo2\"><!--[if !supportLists]-->-<span style=\"font-stretch: normal;\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;\r\n</span><!--[endif]-->Làm việc trong môi trường thân thiện,chuyên nghiệp.</p>\r\n\r\n<p class=\"MsoListParagraphCxSpMiddle\" style=\"text-indent:-.25in;mso-list:l1 level1 lfo2\"><!--[if !supportLists]-->-<span style=\"font-stretch: normal;\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;\r\n</span><!--[endif]-->Được hưởng mọi chế độ phúc lợi và BHXH theo Quy\r\nđịnh hiện hành.</p>\r\n\r\n<p class=\"MsoListParagraphCxSpLast\" style=\"text-indent:-.25in;mso-list:l1 level1 lfo2\"><!--[if !supportLists]-->-<span style=\"font-stretch: normal;\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;\r\n</span><!--[endif]-->Được đào tạo nghiệp vụ&nbsp; nếu chưa có kinh nghiệm.</p>\r\n\r\n<p class=\"MsoNormal\"><span style=\"font-weight: bold;\">** Hồ sơ:</span> Bộ hồ\r\nsơ gồm :</p>\r\n\r\n<p class=\"MsoListParagraphCxSpFirst\" style=\"text-indent:-.25in;mso-list:l1 level1 lfo2\"><!--[if !supportLists]-->-<span style=\"font-stretch: normal;\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;\r\n</span><!--[endif]-->Sơ yếu lí lịch.</p>\r\n\r\n<p class=\"MsoListParagraphCxSpMiddle\" style=\"text-indent:-.25in;mso-list:l1 level1 lfo2\"><!--[if !supportLists]-->-<span style=\"font-stretch: normal;\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;\r\n</span><!--[endif]-->Chứng minh nhân dân photo.</p>\r\n\r\n<p class=\"MsoListParagraphCxSpMiddle\" style=\"text-indent:-.25in;mso-list:l1 level1 lfo2\"><!--[if !supportLists]-->-<span style=\"font-stretch: normal;\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;\r\n</span><!--[endif]-->Sổ hộ khẩu photo.</p>\r\n\r\n<p class=\"MsoListParagraphCxSpLast\" style=\"text-indent:-.25in;mso-list:l1 level1 lfo2\"><!--[if !supportLists]-->-<span style=\"font-stretch: normal;\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;\r\n</span><!--[endif]-->Đơn xin việc.</p><p class=\"MsoListParagraphCxSpLast\" style=\"text-align: center; text-indent: -0.25in;\"><span class=\"Apple-tab-span\" style=\"white-space:pre\">		</span>Hồ sơ ứng tuyển xin gửi về: Văn phòng Công ty Hoàng Hà,&nbsp; số 8, Chùa Bộc, Đống Đa, Hà Nội.</p><p class=\"MsoNormal\" style=\"text-align: center; margin-left: 0.25in;\">Liên hệ (Trong giờ hành chính) :&nbsp;<span style=\"font-weight: bold;\">094 730 5656 / 0473005656</span>&nbsp;- Gặp Hương</p><p class=\"MsoListParagraphCxSpLast\" style=\"text-align: center; text-indent: -0.25in;\">--------------------------------</p><p class=\"MsoListParagraphCxSpLast\" style=\"text-align: center; text-indent: -0.25in;\"><img src=\"http://bototayninhtaisanh.com/images/13867072_1218535468190853_1221074095_n.jpg\" alt=\"\" align=\"\" border=\"0px\"></p><p class=\"MsoNormal\" style=\"margin-left:.25in\"><br></p>\r\n\r\n\r\n\r\n<p class=\"MsoNormal\"><o:p>&nbsp;</o:p></p>', '', null, '0', '1', '0000-00-00 00:00:00', '2016-07-30 14:56:12', '', '', '', '1');
